content:
别称《擅长捉弄的西片太太》的《擅长捉弄的高木同学》改编自山本崇一郎创作的漫画，动画由SHIN-EI动画制作，第一季于2018年1月8日起在TOKYO MX首播，中国大陆由爱奇艺正版发布，全12话。第二季版权已被b站购买，并于19年7月7日23:00开播（在这里感谢哔哩哔哩矿产企业有限公司）。这部动画讲述了一个傻小子被高情商女同桌天天逗着玩，观众被虐的故事。

注意事项:1.糖尿病患者慎看;
2. 单身狗慎看;
3.情侣慎看;
4. 如果你吹高木同学我们就是异父异母的好兄弟！

↓高木调戏西片的次数

